import Menu from  './Menu'
import Pages from  './Pages'
import Footer from  './Footer'
import Navigation from './routes/Navigation'

function App() {
  return (
    <div className="wrapper">
      <Header/>
      <Menu/>
      <Pages/>
      <Footer/>
    </div>
  );
}

export default App;
